import App from 'next/app';
import Head from 'next/head';
import { AppProvider } from '@shopify/polaris';

class MyApp extends App {
  render() {
    const { Component, pageProps } = this.props;
    return (
      <React.Fragment>
        <Head>
          <title>Sample App</title>
          <meta charSet="utf-8" />
        </Head>
          <Component {...pageProps} />
      </React.Fragment>
    );
  }
}

export default MyApp;
